import React, { Component } from "react";

class Footer extends Component {
  render() {
    return (
      <footer className="main-footer">
        <strong>Summit Innovations (Pvt) Ltd Copyright &copy; 2020</strong> All
        rights reserved.
      </footer>
    );
  }
}

export default Footer;
